import home1 from '../img/home1.png';
import '../css/Start.css';

function Start() {
  return (
    <div className="all">
      <img className="bridge" src={home1}>
        <div className="menuBtn">
          <ul className="homeBtn">
            <li className="hBtn">dddd</li>
            <li className="hBtn">음식점</li>
            <li className="hBtn">맛집</li>
            <li className="hBtn">기타</li>
          </ul>
        </div>
      </img> 
    </div>
  );
}

export default Start;
